const scrapedin = require('scrapedin')
const options = {
  email: "wjswogus0007@gmail.com",
  password: "Jh110455!"
}
scrapedin(options)
.then((profileScraper) => profileScraper('https://www.linkedin.com/in/yj42kim/',500))
.then((profile) => module.exports = profile ).catch(err => console.log(err));
